import { useState } from "react";
import ChartMain from "./ChartMain/ChartMain";
import ChartOption from "./ChartOption/ChartOption";

import style from "./Chart.module.css";

function Chart() {
  return (
    <div className={style.chart}>
      <ChartOption />
      <ChartMain />
    </div>
  );
}

export default Chart;
